r\n<link href=\"${indexCss}\" rel=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n\r\n<body>\r\n	<!-- <form action=\"select-date\" method = \"post\" > -->\r\n		<div style=\"margin:10px 0 auto 10px\"><label for=\"date_sel\">Select Date: </label>\r\n		<input type=\"date\" id=\"date_sel\" name=\"selected_date\" onchange=\"#\"></div>\r\n	<!-- </form> -->\r\n	\r\n	\r\n<!-- <button onclick=\"myFunction()\">Select Date</button>\r\n<script>\r\nfunction myFunction() {\r\n  var x = document.createElement(\"INPUT\");\r\n  x.setAttribute(\"type\", \"date\");  \r\n  document.body.appendChild(x);\r\n}\r\n</script> -->\r\n\r\n</body>\r\n</html>','select date','Select date of book issue or return','Library Management System','select date',_binary '\0',_binary '<%@ taglib prefix=\"spring\" uri=\"http://www.springframework.org/tags\"%>\r\n<%@ page language=\"java\" contentType=\"text/html; charset=ISO-8859-1\" pageEncoding=\"ISO-8859-1\" session=\"true\" errorPage=\"error.jsp\"%>\r\n\r\n<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"author\" content=\"Webteam\">\r\n<title>Preview | RCL</title>\r\n<spring:url value=\"/resources/css/index.css\" var=\"indexCss\" />\r\n<%@ taglib prefix=\"c\" uri=\"http://java.sun.com/jsp/jstl/core\"%>\r\n<link href=\"${indexCss}\" rel=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n\r\n<body>\r\n\r\n<jsp:include page=\"HeaderComp.jsp\"></jsp:include>\r\n\r\n\r\n\r\n<div id=\"page\">\r\n	<div id=\"content\">\r\n		<div id=\"title\"><h2>${category }</h2>\r\n		<span class=\"welcome\">Welcome,</span></div>\r\n		<div class=\"body\" align=\"center\">\r\n			<form method=\"post\" action=\"issue-return\">\r\n				<h3 style=\"margin:10px 0;font-size:24px\">Issue/Return</h3>\r\n				<h3 style=\"margin:10px 0;font-size:24px\">Fill the form.</h3>\r\n				<p>An user can only issue a maximum of 3 books at a time.</p>\r\n				<div style=\"margin:10px 0\">\r\n					<label style=\"display:blo