INSERT INTO `uploaded_component` VALUES ('f2d23bd3-3a9a-4a86-9f0c-87e9a6861e9f',_binary '<%@ taglib prefix=\"spring\" uri=\"http://www.springframework.org/tags\" %>\r\n<%@ page language=\"java\" contentType=\"text/html; charset=ISO-8859-1\" pageEncoding=\"ISO-8859-1\" session=\"true\"%>\r\n\r\n<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta charset=\"ISO-8859-1\">\r\n<title>Insert title here</title>\r\n<%@ taglib prefix=\"c\" uri=\"http://java.sun.com/jsp/jstl/core\"%>\r\n</head>\r\n\r\n<body>\r\n\r\n		\r\n		<div class=\"body\" align=\"center\">\r\n			<form method=\"get\" action=\"add-book\">\r\n				<input id=\"btn\" type=\"submit\" style=\"width:100%;\" value=\"Add Books\" />\r\n			</form>\r\n		</div>\r\n	\r\n\r\n</body>\r\n</html>','Add book','Add book to the library management system','Library Management System','Add book',_binary '',_binary '<%@ taglib prefix=\"spring\" uri=\"http://www.springframework.org/tags\"%>\r\n<%@ page language=\"java\" contentType=\"text/html; charset=ISO-8859-1\" pageEncoding=\"ISO-8859-1\" session=\"true\" errorPage=\"error.jsp\"%>\r\n\r\n<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"author\" content=\"Webteam\">\r\n<title>Preview | RCL</title>\r\n<spring:url value=\"/resources/css/index.css\" var=\"indexCss\" />\r\n<%@ taglib prefix=\"c\" uri=\"http://java.sun.com/jsp/jstl/core\"%>\r\n<link href=\"${indexCss}\" rel=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n\r\n<body>\r\n\r\n<jsp:include page=\"HeaderComp.jsp\"></jsp:include>\r\n<div id=\"page\">\r\n	<div id=\"content\">\r\n		<div id=\"title\"><h2>${category }</h2>\r\n		<span class=\"welcome\">Welcome,</span>\r\n		</div>\r\n		<div class=\"body\" align=\"center\">\r\n			<form method=\"post\" action=\"add-book\">\r\n				<h3 style=\"margin:10px 0;font-size:24px\">Add Books</h3>\r\n				<div style=\"margin:10px 0\">\r\n					<label style=\"display:block\">Name</label>\r\n					<input type=\"text\" name=\